import React from 'react';
import './Graph.css';

function Graph({ themes, onThemeClick }) {
  const renderNode = (node) => (
    <div key={node.id} className="node" onClick={() => onThemeClick(node)}>
      {node.name}
    </div>
  );

  return (
    <div className="graph">
      {themes.map(renderNode)}
    </div>
  );
}

export default Graph;
